import React from 'react';

import * as S from './styles';

const ClientSections: React.FC = () => {
  return (
    <S.Container>
      <h3>Clientes</h3>
      <p>Lorem ipsum dolor, sit amet consectetur adipisicing elit. </p>
      <S.CarouselContainer>
        <h1>1</h1>
        <h1>2</h1>
        <h1>3</h1>
      </S.CarouselContainer>
    </S.Container>
  )
}

export default ClientSections;
